import React from 'react';
//images
import Dwight from '../assets/dwight.png';
import Michael from '../assets/michael.png';

const Space = ({ space, capture, index }) => {
	return (
		<div
			className="space"
			onClick={() => {
				capture(index);
			}}
		>
			<img src={space === 'O' ? Dwight : Michael} />
		</div>
	);
};

export default Space;
